	["so_red"] = { name = "Карамельное яблоко", desc = "Отдельные части оружия покрашены аэрозольной краской в сплошные красный и черный цвета.\n\nОтлично смотрится на автомобилях, но на оружии — ещё лучше" },
	["so_purple"] = { name = "Ультрафиолет", desc = "Отдельные части оружия покрашены аэрозольной краской в сплошные черный и розовый цвета.\n\nЭлегантный, но брутальный дизайн" },
	["so_night"] = { name = "Ночь", desc = "Отдельные части оружия покрашены аэрозольной краской в сплошные цвета ночного пейзажа. \n\nСловно шепот ветра… Словно укус в шею" },
	["so_caramel"] = { name = "Карамель", desc = "Отдельные части оружия покрашены аэрозольной краской в сплошные карамельный и черный цвета." },
	["so_grassland"] = { name = "Цвет луга", desc = "Отдельные части оружия покрашены аэрозольной краской в сплошные цвета травы." },
	["so_moss"] = { name = "Голубая хвоя", desc = "Отдельные части оружия покрашены аэрозольной краской в сплошные цвета мха." },
	["so_sand"] = { name = "Песчаные дюны", desc = "Отдельные части оружия покрашены аэрозольной краской в сплошные цвета песчаных дюн.\n\n«Теперь, когда Тернер мертв, у нас новая задача: спасти Алекса Кинкейда», — командир Феликс Райли" },
	["so_stormfront"] = { name = "Гроза", desc = "Отдельные части оружия покрашены аэрозольной краской в сплошные цвета грозы.\n\nГроза террористов" },
	["so_tornado"] = { name = "Смерч", desc = "Отдельные части оружия покрашены аэрозольной краской в сплошные цвета торнадо.\n\nНе дайте простоте обмануть вас" },
	["so_whiteout"] = { name = "Снежная мгла", desc = "Белая краска нанесена на всю поверхность оружия.\n\nБезобидный внешний вид может быть обманчив" },
	["so_jungle"] = { name = "Джунгли", desc = "Отдельные части оружия покрашены аэрозольной краской в цвета джунглей." },
	["so_space_marine"] = { name = "Колония", desc = "Отдельные части оружия покрашены аэрозольной краской в серый цвет и цвет хаки." },
	["so_pmc"] = { name = "Наемник", desc = "Отдельные части оружия покрашены аэрозольной краской в светло-коричневый, тёмно-синий и тёмно-зелёный цвета.\n\nРона Сабри так и не простила Себастьену, что он не назначил её выслеживать Тёрнера" },
	["so_tangerine"] = { name = "Подрыв", desc = "Отдельные части оружия покрашены аэрозольной краской в черный и оранжевый цвета.\n\n«Рона действительно хороша… Правда, она еще не созрела для мысли, что не стоит говорить об этом каждому встречному», — командир Феликс Райли" },
	["so_orange_accents"] = { name = "Нитро", desc = "so_orange_accents" },
