	["hy_dive"] = { name = "Подводный камуфляж", desc = "Текстура синего камуфляжа нанесена водостойкой краской.\n\n«Мы привыкли скрываться… Но иногда камуфляж создан для того, чтобы его увидели», — Бут, торговец оружием" },
