	["hy_skulls"] = { name = "Черепа", desc = "Текстура черных или красных черепов была нанесена водостойкой краской.\n\nБратская могила, которая помещается в ваших ладонях" },
	["hy_webs"] = { name = "Кровавая паутина", desc = "На отдельные части оружия нанесли водостойкую краску красного цвета, черные узоры паутины и слой полуглянца.\n\nВнимательно смотри, куда идешь, ведь никогда не знаешь, где можно угодить в паутину" },
	["hy_splatter"] = { name = "Синяя струя", desc = "Окрашено с использованием полупрозрачной аквапечати в виде узора брызг на синей основе." },
