	["sp_mesh_sand"] = { name = "Песчаная сетка", desc = "sp_mesh_sand" },
	["sp_snake"] = { name = "Змеиная кожа", desc = "Баллончиком был нанесен рисунок с использованием трафарета из змеиной кожи, вырезанного вручную." },
	["an_silver"] = { name = "Серебро", desc = "Основу сначала окрасили в хромовый оттенок, а потом нанесли на неё тонкий слой серебра, чтобы создать эффект анодированного покрытия.\n\n«Красота в простоте», — Франц Крайгельд, тактик подразделения «Феникс»" },
	["an_red"] = { name = "Хот-род", desc = "На основу нанесли хромовое покрытие, а потом окрасили тонким слоем красной краски, чтобы создать эффект анодированного металла.\n\nАвтоматическое. Систематическое. Гидродинамическое." },
	["an_gunmetal"] = { name = "Анодированный металл", desc = "an_gunmetal" },
	["an_navy"] = { name = "Анодированная синева", desc = "На основу нанесли хромовое покрытие, а потом окрасили тонким слоем краски с оттенком морской синевы, чтобы создать эффект анодированного металла." },
	["am_urban"] = { name = "Пиксельный камуфляж «Металлический»", desc = "На металлическую основу с помощью аквапечати нанесли пиксельный камуфляж." },
	["am_tiger"] = { name = "Золотой тигр", desc = "Сюда нанесли позолоченное покрытие и сделали гравировку в виде полос на тигриной шкуре." },
	["am_dragon_glock"] = { name = "Татуировка дракона", desc = "На основу с металлическим оттенком наклеили узор в виде дракона.\n\n«В сказке рыцарь всегда побеждает дракона. Но реальный мир — далеко не сказка», — Валерия Дженнер, революционер" },
	["am_caustics"] = { name = "Каустика", desc = "На металлическую основу угольно-черного цвета нанесли белую и красную аквапечать." },
	["am_lightning_awp"] = { name = "Удар молнии", desc = "На металлическую основу нанесли в виде молний краску с анодированным эффектом.\n\nИногда не нужно бить в одно и то же место дважды" },
	["am_ossify"] = { name = "Окостеневший", desc = "На металлическую основу нанесли абстрактный узор светло-зеленого оттенка." },
	["aa_flames"] = { name = "Пламя", desc = "Аэрографический рисунок был нанесен прозрачной краской на основное хромовое покрытие." },
	["aa_splash_p250"] = { name = "Брызги", desc = "Аэрографический рисунок был нанесен прозрачной краской с помощью трафарета на основное хромовое покрытие." },
	["aa_fade"] = { name = "Градиент", desc = "Корпус покрыт хромовой основой, которую с помощью баллончика покрасили в полупрозрачные, плавно переходящие друг в друга цвета.\n\n«Это не только оружие, но и весомый аргумент в разговоре», — Имоген, начинающая торговка оружием" },
	["aa_fade_metallic"] = { name = "Янтарный градиент", desc = "aa_fade_metallic" },
	["aa_fade_grassland"] = { name = "Кислотный градиент", desc = "aa_fade_grassland" },
	["aq_copper"] = { name = "Медь", desc = "Покрыт медью." },
	["aq_blued"] = { name = "Вороненая сталь", desc = "Раскрашен под холодный оттенок голубого цвета.\n\n«Если сравнивать ножи с вином, то этот можно считать самым изысканным», — Бут, торговец оружием" },
	["aq_forced"] = { name = "Патина", desc = "Поверхность покрыта патиной цветов горчицы и лимона.\n\nЕсли вы думаете, что здесь грязновато, попробуйте посмотреть в ультрафиолетовом спектре" },
	["aq_oiled"] = { name = "Поверхностная закалка", desc = "Закалено с использованием древесного угля на высоких температурах.\n\nНемного цвета никому не повредит" },
	["sp_spitfire_famas"] = { name = "Истребитель", desc = "sp_spitfire_famas" },
	["am_zebra"] = { name = "Убийство", desc = "Был покрашен в полоску красками с алюминиевым и хромовым отблеском, а потом покрыт томатно-красным цветом.\n\nВалерия платила Хавьеру не за то, чтобы тот задавал вопросы… а за то, чтобы он выбивал ответы" },
	["am_zebra_dark"] = { name = "Тёмная вода", desc = "На хромированную основу нанесен узор из полос и пятен металлических оттенков.\n\nВода дарует жизнь, но иногда может и отнять…" },
	["aa_vertigo"] = { name = "Гипноз", desc = "На перламутровую основу с помощью трафарета и баллончика с краской нанесли узор черного цвета.\n\nВы не засыпаете, вы теряете сознание от потери крови" },
	["cu_spring_nova"] = { name = "Расцветающая ветка", desc = "Ружье было вручную расписано под вишню посредством аэрографии, а сверху нанесен глянцевый лак." },
	["sp_hazard"] = { name = "Желто-черные полосы", desc = "sp_hazard" },
	["aq_rust"] = { name = "Ржавчина", desc = "Хотя внешняя поверхность покрылась ржавчиной, боеспособность этого оружия не вызывает никаких нареканий." },
	["am_slither_p90"] = { name = "Хладнокровный", desc = "На основу нанесли хромовое покрытие, а потом окрасили тонким слоем красной краски, чтобы создать эффект анодированного металла. Лазером был выгравирован узор в форме змеиной кожи." },
	["am_carbon_fiber"] = { name = "Углепластик", desc = "На основу угольно-черного цвета нанесено карбоновое покрытие.\n\n«Я лучшая в своей команде, но я бы не справилась без нее», — Рона Сабри, многообещающий военный" },
	["am_scorpion_p2000"] = { name = "Скорпион", desc = "Окрашен анодизирующей краской с легким эффектом ряби, а также имеет наклейку в виде красного скорпиона на рукоятке." },
	["hy_feathers_aug"] = { name = "Крылья", desc = "Украшен наклейками в виде орлиных перьев.\n\nВы не сможете увидеть величие орла, если он выцарапает вам глаза" },
	["sp_palm_shadow"] = { name = "Тропическая гроза", desc = "sp_palm_shadow" },
	["cu_walnut_nova"] = { name = "Грецкий орех", desc = "Часть оружия была окрашена в каштановый цвет." },
	["aq_brass"] = { name = "Латунь", desc = "Некоторые части корпуса заменены на латунные.\n\nЗолото дураков" },
	["hy_blam"] = { name = "БАБАХ!", desc = "На оранжевую основу с помощью аквапечати нанесли узор в виде облачков звукоподражаний из комиксов." },
	["hy_blam_simple"] = { name = "БАХ", desc = "hy_blam_simple" },
	["sp_dapple"] = { name = "Сажа", desc = "Рисунок в виде опаленных солнцем пятен нанесен баллончиком.\n\n«Феникс — это не символ разрушения, а символ перерождения», — Валерия Дженнер, революционер" },
	["sp_splash_p250"] = { name = "Пятно", desc = "Рисунок нанесен баллончиком с использованием трафарета в виде пятна от краски." },
