	["hy_crumple_bravo"] = { name = "Осколки", desc = "Этот сувенир с Agency был украшен многоугольными узорами, нанесенными водоотталкивающий краской.\n\n«Мои люди — профессионалы, и они справятся с работой…» — Эллиот Кингсман, преступник со стажем" },
