	["cu_pinstripe_ak47"] = { name = "Изумрудные завитки", desc = "Дубовая поверхность покрыта белыми и зелеными завитками.\n\n«Не доверяешь моей дочери? Значит, не доверяешь и мне. Успокойся, выпей, и уж тогда побеседуем», — Отец и Феникс, часть 2" },
	["sp_nightstripe"] = { name = "Ночная полоса", desc = "Баллончиком нанесён узор цвета ночной маскирующей ленты.\n\nНож внутри, а кровь снаружи." },
	["cu_m4_asimov"] = { name = "Азимов", desc = "Раскрашено вручную в стиле научной фантастики.\n\nКто угодно может предсказать будущее… но лишь мечтатель претворяет его в жизнь" },
