	["cu_m4a1-s_elegant"] = { name = "Страж", desc = "Раскрашено в синий цвет кобальта. С логотипом спецназа на магазине.\n\n«Ты можешь мне не нравиться, но я обязана защищать тебя», — Кармен Кочинеро, специалист по спасению заложников" },
