	["cu_awp_cobra"] = { name = "Красная линия", desc = "Раскрашено с помощью аквапечати с использованием углеродного волокна и украшено наклейками в виде тонких красных линий.\n\nНе бойся выжимать всё до предела" },
	["cu_famas_pulse"] = { name = "Пульс", desc = "Рисунок в виде крупных осколков цвета фуксии нанесен с помощью аквапечати.\n\nБроские цвета для броского оружия" },
