	["am_thorny_rose_mp9"] = { name = "Железная роза", desc = "Рисунок в виде розы с шипами нанесен вручную металлизированной краской различных оттенков.\n\nОпасайтесь шипов" },
	["cu_skull_nova"] = { name = "Восходящий череп", desc = "Изображение в виде черепа нанесено матовой краской поверх рисунка, выполненного маркером на масляной основе.\n\n«Господин Ицаки, я не жалуюсь, но… сколько же дробовиков вам нужно?» — Имоген и Демон, часть 1" },
	["cu_sandstorm"] = { name = "Песчаная буря", desc = "С помощью аквапечати нанесен рисунок в фиолетовых и бежевых тонах.\n\nОдного брезента для защиты будет маловато" },
	["hy_kami"] = { name = "Ками", desc = "С помощью аквапечати нанесен рисунок в стиле японской манги.\n\nНекоторым призракам не найти покоя" },
	["aq_obsidian"] = { name = "Магма", desc = "На нём есть детали с медным покрытием, скрытые за рисунком в виде магмы и красным налётом, полученным с помощью хлорида натрия и высоких температур. Непокрытые области впоследствии были затемнены окислением сернистым калием.\n\nНевероятная огневая мощь" },
