	["cu_nova_antique"] = { name = "Антиквариат", desc = "Раскрашено вручную, используя комбинацию из аквапечати и наклеек, чтобы изобразить деревянный приклад и золотую инкрустацию оружия.\n\nС годами приходит мудрость и мощность выстрела" },
