	["am_royal"] = { name = "Чаша", desc = "Раскрашено в хромированный базовый слой и покрыто королевской синей и янтарной анодированной красками.\n\nМудрый выбор" },
	["am_metals"] = { name = "Рыцарь", desc = "С латунными инкрустациями, похожими на доспехи эпохи Возрождения.\n\n«Что значит \"мы не можем найти Кочинеро и Ицаки\"?», — командир Феликс Райли" },
	["am_chainmail"] = { name = "Кольчуга", desc = "Раскрашено с помощью аквапечати в полупрозрачный узор кольчуги поверх серебряного базового слоя.\n\nИз всех членов «Феникса» вернее всего Валерии служит ее телохранитель Наоми" },
	["aq_handcannon"] = { name = "Пищаль", desc = "Содержит латунные детали, вдохновленные античным оружием, которые были обработаны кислотой для придания эффекта патины.\n\nПредстоит пройти огонь, воду и медные трубы" },
	["am_metal_inlay"] = { name = "Тёмный век", desc = "Раскрашено металлической краской для придания эффекта инкрустированного металла в средневековом мотиве.\n\n«Можно убить ее любовника… Может, тогда Валерия даст тебе немного времени», — Отцовская любовь, часть 2" },
	["hy_vines"] = { name = "Терн", desc = "С помощью аквапечати нанесен рисунок в виде вьющихся лоз и цветов.\n\nИстинный поцелуй любви может причинить боль" },
	["so_indigo"] = { name = "Королевский синий", desc = "Раскрашено в сплошные цвета: индиго, малиновый и серый.\n\n«Улыбнись, Феликс. Может, ты бы привлекал дам, не будь твое лицо таким кислым», — Имоген, начинающая торговка оружием" },
	["so_indigo_and_grey"] = { name = "Индиго", desc = "Раскрашено в сплошные цвета: индиго, синий и серый.\n\n«Алекс Кинкейд, у тебя наверняка много вопросов… Позволь же дать тебе ответы», — Феникс и Рассказчик, часть 1" },
	["cu_well_traveled_ak47"] = { name = "Путешественник", desc = "Его приклад обернут коричневой кожей. Это оружие побывало во многих городах.\n\n«Достаточно присмотреться к ней, и поймешь, что она сделала. На решение у нас мало времени…», — Отцовская любовь, часть 1" },
	["cu_green_leather"] = { name = "Первый класс", desc = "Приклад обернут зеленой кожей.\n\nШампанское в комплект не входит" },
	["cu_brown_leather_p90"] = { name = "Кожа", desc = "Его приклад обернут коричневой кожей.\n\nНе волнуйся, таможня тебя пропустит" },
	["cu_luggage_mac10"] = { name = "Пассажир", desc = "С помощью аквапечати нанесен клетчатый узор, оружие частично обтянуто искусственной крокодиловой кожей.\n\n«Они проглотили наживку. Вперед…», — Эллиот Кингсман, наемник" },
	["cu_medieval_dragon_awp"] = { name = "История о драконе", desc = "Узловой рисунок в виде дракона нанесен вручную.\n\nДаже две сотни ключей не раскроют его секретов" },
	["cu_luggage_p2000"] = { name = "Эконом-класс", desc = "С помощью аквапечати нанесен клетчатый узор, а рукоять обернута коричневой кожей.\n\nПрактичность превыше всего" },
	["aq_pilot_deagle"] = { name = "Пилот", desc = "Нанесена латунная инкрустация крыльев пилота.\n\nПротивник потерпит крушение" },
	["cu_leather_xm1014"] = { name = "Красная кожа", desc = "Рукоять и приклад обтянуты красной кожей.\n\n«Собирайся. Давай убьем эту мразь», — Демон и Валькирия, часть 2" },
	["cu_luggage_sg553"] = { name = "Странник", desc = "Раскрашено в полоску в стиле старинных чемоданов, а некоторые части завернуты в коричневую кожу.\n\nКаждому есть что рассказать, и Хавьер заставит пообщаться, прежде чем убьет" },
	["cu_luggage_usp-s"] = { name = "Бизнес-класс", desc = "Окрашен в цвета и узоры, напоминающие старинный чемодан, некоторые детали отделаны коричневой кожей.\n\nНекоторым недостаточно вытянуть ноги… Им хочется тишины и покоя" },
	["hy_plaid1"] = { name = "Оливковая клетка", desc = "С помощью аквапечати оружие покрасили в бежевый цвет и нанесли узор из оливковых и зеленых квадратов.\n\n«Мне нравится эта пушка. Она подходит под цвет моих глаз», — Рона Сабри, многообещающий военный" },
