	["cu_cerbrus_galil"] = { name = "Цербер", desc = "На оружие нанесено изображение Цербера — мифического трехглавого пса-стражника подземного мира." },
	["cu_tribute_ak47"] = { name = "Пустынный повстанец", desc = "Оружие было зашкурено, его раскрасили с помощью трафарета, а затем нанесли граффити.\n\n«Люди поймут, за что мы боремся, если сами зададутся этим вопросом», — Наоми, телохранитель Валерии Дженнер" },
	["aq_glock_coiled"] = { name = "Жернов", desc = "Ствольная коробка раскрашена масляными красками вручную и с помощью трафарета.\n\nНастоящие бриллианты можно создать только под давлением" },
	["am_g3sg1_murky"] = { name = "Мрак", desc = "Анодирован и окрашен акварельной краской в леопардовый узор.\n\nВсегда есть тьма, еще чернее прежней" },
	["aq_m4a1s_basilisk"] = { name = "Василиск", desc = "На оружие нанесено изображение василиска.\n\nСчитается, что глазеть на других некрасиво, но на войне не место любезным" },
	["cu_m4a4_griffin"] = { name = "Грифон", desc = "Изображение грифона нанесено вручную.\n\nФеликс набирал свою команду по всему миру, и, хоть люди сомневаются в характере исполнителей, на результативность их работы никто не жалуется" },
	["sp_mag7_firebitten"] = { name = "Поджигатель", desc = "Рисунок нанесен баллончиком в несколько слоев, а затем зашкурен, чтобы придать эффект горящих сторон.\n\nПожар всегда начинается с маленькой искры" },
	["cu_mp9_chevron"] = { name = "Дротик", desc = "С помощью аквапечати нанесены полосы в виде шевронов.\n\nЧем больше пытаешься попасть, тем больше шанс" },
	["aq_p250_cartel"] = { name = "Картель", desc = "Нанесена гравировка в виде цветов, черепов и змей.\n\nСпуск курка может обратить любой день в День Мертвых" },
	["cu_p2000_fire_elemental"] = { name = "Дух огня", desc = "Изображение огненного существа в образном стиле нанесено вручную.\n\nИногда игры с огнем приносят пользу" },
	["aq_sawedoff_blackgold"] = { name = "Разбойник", desc = "Узор в виде зарослей чертополоха нанесен черной и золотой лаковой краской.\n\nОттопыривать мизинец во время стрельбы вовсе не обязательно, но это выглядит красиво" },
	["cu_scar20_intervention"] = { name = "Кардио", desc = "Запечатано в виниловую оболочку с современным сине-оранжевым дизайном.\n\nБип. Бип. Би-и-ип…" },
	["sp_ump45_d-visions"] = { name = "Заблуждение", desc = "Трафаретной печатью нанесено изображение морской тематики.\n\nКаркоса зовет" },
	["cu_xm1014_caritas"] = { name = "Спокойствие", desc = "Нанесен рисунок женщины с длинными волосами.\n\n«Не нужда привела меня сюда, но алчность», — Имоген и Демон, часть 2" },
	["am_awp_glory"] = { name = "Боец", desc = "Перед выполнением ручного узора с завихрениями металлической золотой краской на оружие был нанесен слой синего металлика.\n\nУбивать нужно из красивого оружия" },
	["cu_elites_urbanstorm"] = { name = "Городской шок", desc = "Раскрашено вручную в городской камуфляж с синими вставками.\n\nЗа молнией всегда следует гром" },
	["aq_deagle_naga"] = { name = "Нага", desc = "Темой выгравированного рисунка послужила мифология.\n\nНага из индийской мифологии так же смертоносна, как «Нага» на поле боя" },
	["cu_galil_abrasion"] = { name = "Щелкунчик", desc = "Рисунок был выполнен вручную. При стрельбе кажется, будто череп, изображенный на пылезащитной шторке, трещит челюстью.\n\nГоворят, что если вы засмеетесь, то весь мир засмеется с вами… Но когда смеется «Щелкунчик», мир кричит от ужаса" },
	["cu_glock_deathtoll"] = { name = "Захоронение", desc = "Узор в форме черепов выполнен с помощью аквапечати поверх базового слоя, нанесенного серебряным металликом.\n\nЕсли вас пытаются запугать — значит, вас уважают" },
	["cu_m4a4_ancestral"] = { name = "龍王 (Король драконов)", desc = "Рисунок в виде дракона в красно-синих цветах нанесен вручную.\n\n«Это оружие достойно Короля обезьян», — Бут, торговец оружием" },
	["cu_m249_sektor"] = { name = "Блокировка", desc = "Раскрашено вручную в стиле научной фантастики.\n\nКрасочный огонь на подавление" },
	["am_mac10_malachite"] = { name = "Малахит", desc = "Волнистый узор нанесен резиновым гребнем поверх металлической окраски.\n\nОружие с яркой окраской и мрачным назначением" },
	["cu_mp9_deadly_poison"] = { name = "Смертельный яд", desc = "Стилизованный рисунок паука и угловатые, динамичные фигуры нанесены вручную.\n\nПервый укус вас не убьет, но за ним последует еще 29" },
	["cu_p250_mandala"] = { name = "Покойник", desc = "Рисунок с круглыми кружевными узорами нанесен вручную.\n\nТрадиционно кровавый" },
	["cu_sawedoff_deva"] = { name = "Безмятежность", desc = "Рисунок в виде женщины с крыльями нанесен вручную.\n\n«Безмятежность — это роскошь, доступная лишь немногим», — Валерия Дженнер, революционер" },
	["aq_scar20_leak"] = { name = "Грот", desc = "Окрашено синей металлической краской с помощью губки и кисти.\n\nОснователь корпорации «Season» заказал это оружие именитому спецназовцу Котаро Ицаки в знак благодарности за спасение" },
	["aq_xm1014_sigla"] = { name = "Ртуть", desc = "Узор в виде карты местности нанесен с помощью аквапечати поверх серебряной основы.\n\n«Иногда эффект неожиданности помогает решить ваши проблемы», — Котаро Ицаки, специалист по штурму" },
	["an_tiger_orange"] = { name = "Зуб тигра", desc = "Анодирован в оранжевый цвет, также вручную нанесена гравировка в форме полос тигра.\n\nРедкий, словно тигр… Смертельный, словно тигр…" },
	["am_marble_fade"] = { name = "Мраморный градиент", desc = "Окрашено черной и серебряной металлической краской под мрамор, а затем нанесен трехцветный градиент.\n\nНа лезвии много цветов, но вскоре останется лишь цвет крови" },
	["am_marbleized"] = { name = "Волны", desc = "Окрашено черной и серебряной металлической краской под мрамор, а затем нанесен градиент.\n\nЧрезмерно усердное разглядывание приводит к летальному исходу" },
	["cu_ak47_mastery"] = { name = "Elite Build", desc = "It has been custom painted using a combination of hydrographics and careful stenciling and detailed with heat-transfer decals.\n\nTread softly Naomi...people in your line of work aren't known for their longevity - The Shield and The Serpent Part 2" },
	["aq_mp7_ultramodern"] = { name = "Броня", desc = "Окрашено черной краской на масляной основе с инкрустацией и украшениями из нержавеющего метала.\n\n«Идеально для спецназовца, одинаково ценящего утонченность и огневую мощь», — Бут, торговец оружием" },
	["aq_awp_twine"] = { name = "Бог червей", desc = "Рисунок черепа и корней, нанесенный стойкими эмалевыми красками.\n\nНекоторых корней лучше не касаться" },
	["am_bronze_sparkle"] = { name = "Бронзовая декорация", desc = "Окрашено декоративными мотивами с помощью автомобильной краски металлик.\n\nВсе хотят себе серебра и золота" },
	["aq_p250_contour"] = { name = "Валентность", desc = "Вручную окрашено синими и серыми красками, подчеркивающими форму оружия.\n\n«Меня волнуют не твои навыки, а твое отношение к делу», — Учитель и бунтарь, часть 1" },
	["cu_fiveseven_banana"] = { name = "Обезьянье дело", desc = "Это банан.\n\nИногда с едой можно и поиграться" },
	["cu_galil_eco"] = { name = "Эко", desc = "Окрашено белой и зелёной краской и украшено термонаклейками.\n\nЗа достойную плату элитный отряд примет любую сторону" },
	["aq_famas_jinn"] = { name = "Джинн", desc = "Инкрустировано золотом и никелем, выгравировано изображение джинна\n\nБудь осторожен со своими желаниями" },
	["cu_m4a1_hyper_beast"] = { name = "Hyper Beast", desc = "It has been custom painted with a beastly creature in psychadelic colours.\n\nYou really want to impress me Booth? Make this black light sensitive - Rona Sabri, Rising Star" },
	["cu_mag7_redhot"] = { name = "PaintKit_cu_mac10_redhot_tag", desc = "PaintKit_cu_mac10_redhot" },
	["am_negev_glory"] = { name = "PaintKit_am_awp_glory_Tag", desc = "PaintKit_am_awp_glory" },
	["cu_mac10_neonrider"] = { name = "Неоновый гонщик", desc = "На корпус нанесено изображение беспощадного байкера.\n\nНаполовину оружие, наполовину привет из прошлого." },
	["cu_sawedoff_origami"] = { name = "Оригами", desc = "Покрашено вручную в стиле оригами.\n\nНужно много времени, чтобы создать что-то прекрасное, но достаточно мгновения, чтобы это уничтожить" },
	["cu_cz75_precision"] = { name = "Поул-позиция", desc = "Окрашено на заказ красными и серыми гоночными мотивами.\n\n«У нас только один шанс, так что давайте сделаем все правильно», — командир Феликс Райли" },
	["am_ump_racer"] = { name = "Гран-при", desc = "Вручную нанесен гоночный узор в стиле ретро.\n\nНе забудь надеть шлем" },
