	["cu_AK47_Anarchy"] = { name = "Неоновая революция", desc = "Поверхность оружия покрыта разнообразными наклейками и обильно обрызгана краской.\n\nОбязательный инструмент любого отряда самоубийц" },
	["gs_AUG_Syd_Mead"] = { name = "Сид Мид", desc = "Окрашено знаменитым художником Сидом Мидом.\n\nВ прошлом он просто показывал нам будущее, теперь же он вложил его нам в руки..." },
	["gs_CZ75_Tread"] = { name = "Штамп", desc = "Вручную нанесена аккуратная гравировка.\n\nОружие от кутюр завоевало всю Чешскую республику" },
	["aq_Desert_Eagle_Constable"] = { name = "Директива", desc = "Это оружие поможет защитникам будущего уберечь нас от гадов.\n\nТвой ход..." },
	["gs_FAMAS_Rally"] = { name = "Защитный каркас", desc = "Наклейки придают этому оружию сходство с заляпанным грязью шасси.\n\nБезопасность прежде всего" },
	["aq_Five_Seven_Scumbria"] = { name = "Скумбрия", desc = "Украшено аккуратными линиями.\n\n«Ты не можешь оставить его умирать, Феликс. Ты должен спасти его», — Дочь и Паладин, часть 1" },
	["gs_G3SG1_Ventilator"] = { name = "Духовик", desc = "Элегантная черная окраска и хромирование, дополненные уникальным резиновым прикладом.\n\n«Не бойся, Наоми, я заставлю Феликса заплатить», — Миха Битон, снайпер «Феникса»" },
	["cu_Glock18_Weasel"] = { name = "Ласка", desc = "Аквапечатью нанесен рисунок своенравного самца ласки по имени Бобби. Не злите его.\n\nДаже ласковый укус может стать смертельным" },
	["cu_MAG7_Tribal"] = { name = "Петроглиф", desc = "Окраска имитирует наскальную живопись.\n\n«Конфликты существуют с того дня, когда первый пещерный человек взял в руки камень», — Бут, торговец оружием" },
	["cu_MP9_Narcis"] = { name = "Воздушный шлюз", desc = "Окрашено в белый цвет с выделяющейся красной обоймой.\n\nОтлично подходит для стрельбы по тостерам" },
	["hy_Negev_Dazzle"] = { name = "Конфуз", desc = "Покрыто синими и белыми наклейками в виде полосок зебры.\n\nРадость для любителей истории военного дела" },
	["cu_P90_Grimm"] = { name = "Мрак", desc = "Аквапечатью нанесено изображение смертоносных призраков, а затем сухой кисточкой добавлены зеленые отблески.\n\n«Имоген... Я просила пушку, а не картину», — Рона Сабри, многообещающий военный" },
	["gs_SCAR20_Powercore"] = { name = "Генератор", desc = "Корпус окрашен в зелёный цвет, а некоторые детали выделены жёлтой краской. Дополнено штрих-кодом для удобства покупателя.\n\nПравило номер один — завоевать сердце клиента" },
	["cu_SG556_Triarch"] = { name = "Триарх", desc = "Эта винтовка, окрашенная в песчаный камуфляж, заказана членом королевской семьи.\n\nМонарх не забывает о своих подопечных" },
	["gs_TEC9_Supercharged"] = { name = "Топливный инжектор", desc = "Корпус окрашен в желтый цвет, а на обойму аквапечатью нанесен рисунок ремневого привода. Классическую сиэтльскую композицию завершает обернутая кожей рукоять.\n\nТехобслуживание в стоимость не входит" },
	["cu_UMP45_Metritera"] = { name = "Брифинг", desc = "Аквапечатью нанесен рисунок топографической карты.\n\nВстреча будет недолгой..." },
	["hy_XM1014_Fractal_Blue"] = { name = "Поток", desc = "Окрашено в дымчато-серый и ярко-голубой цвета.\n\n«Терпение, Эллиот; они ещё сыграют свою роль...», — Наёмник и змей, часть 2" },
	["am_czv2_mf"] = { name = "Полимер", desc = "На затвор нанесен рельефный узор, напоминающий полимерную структуру.\n\n«Если ты больше не справляешься с \"Фениксом\", мы сами за себя постоим», — Дочь и Паладин, часть 2" },
	["aq_glock_dark-fall"] = { name = "Литьё", desc = "На затворе лазером выгравирован узор в виде шипастых лоз.\n\nЕсли за садом не ухаживать, он превратится в плотный клубок сорняков" },
	["cu_ssg08_dragonfire_scope"] = { name = "Пламя дракона", desc = "Аквапечатью нанесен рисунок чудовищного огнедышащего дракона.\n\nСторожи свое богатство и приманивай на него других" },
	["gs_dual_berettas_golden_venice"] = { name = "Королевская чета", desc = "Рукоять, покрашенная зеленой перламутровой краской, боковые пластины с изображением грифона и затвор с лазерной гравировкой меняют представление об элегантности.\n\nПистолеты к бою, господа" },
	["gs_famas_mecha"] = { name = "Механо-пушка", desc = "Контрастный черно-белый дизайн придает этому оружию футуристический вид, будто оно из научно-фантастического фильма.\n\nСиняя краска для волос и робот-компаньон в комплект не входят" },
	["gs_final_pooldeadv2"] = { name = "Перистое облако", desc = "Окрашено небесно-голубой металлической краской, на которую нанесена наклейка с изображением черепа.\n\nХватит витать в облаках" },
	["gs_g3sg1_viper_yellow"] = { name = "Жало", desc = "Некоторые элементы были подчеркнуты желтой и серой красками.\n\nВспышка боли — а потом ничего." },
	["cu_galil_ar-camo"] = { name = "Чёрный песок", desc = "На корпус нанесён узор, сочетающий чёрные фигуры и камуфляж.\n\nМиха Битон собирается выступить против Коалиции Спецназначения" },
	["aa_hide-mp9"] = { name = "Пыльный осадок", desc = "Серый и бежевый цвета отрисованы в заказном узоре.\n\n«Нам нужно ждать возмездия», — командир Феликс Райли" },
	["cu_m4a1_flashback"] = { name = "Взгляд в прошлое", desc = "Вручную нанесен узор, призванный напомнить о двойственной природе человека.\n\nДля весельчака в каждом из нас" },
	["gs_m4a4_sector"] = { name = "Облом", desc = "Это оружие от Sektor Industry аккуратно окрашено в жёлтый и зёленый цвета.\n\nИспортит любой праздник" },
	["am_mag7_malform"] = { name = "Эхолот", desc = "Через трафарет нанесен нежно-бирюзовый узор.\n\n«Твоя правда, поражение мне в новинку», — Демон и Валькирия, часть 2" },
	["am_nova_sand"] = { name = "Ядозуб", desc = "На оружие нанесен рельефный узор в форме кожи ящерицы.\n\n«Ты ведешь себя так, будто наемники ни разу не брали тебя в плен», — Демон и Валькирия, часть 1" },
	["gs_p2000-sport"] = { name = "Дерн", desc = "Рукоять и затвор окрашены металлической зеленой краской.\n\nУ соседей всегда трава краснее" },
	["gs_p90_shallow_grave"] = { name = "Неглубокая могила", desc = "Рисунок на рукоятях напоминает рунные камни, а на приклад аквапечатью нанесено изображение скелета.\n\nЕсли трупов так много, какой прок копать?" },
	["cu_usp_cyrex"] = { name = "Сайрекс", desc = "Контрастные красные элементы придают оружию футуристический вид.\n\n«Имоген в прошлом, Феликс. Я — ваше будущее», — Хаксли, конкурент" },
	["cu_wp_sawedoff"] = { name = "Принцесса пустошей", desc = "Кто-то после каждого убийства делал на стволе засечку.\n\nЛучший подарок для социопата, у которого есть всё…" },
	["gs_ak47_bloodsport"] = { name = "Кровавый спорт", desc = "На корпус нанесена красно-чёрная аквапечать, покрытая множеством белых наклеек-логотипов.\n\nТребуется второй пилот" },
	["cu_awp_psychopath"] = { name = "Горячечные грёзы", desc = "Корпус покрыт чёрной основой, на которую нанесены розовые, голубые и фиолетовые рисунки.\n\nБезумие до добра не доведёт" },
	["hy_bizon_torn_green"] = { name = "Вихрь джунглей", desc = "Аквапечатью нанесён жёлто-зелёный рисунок.\n\nСледуй за лидером" },
	["cu_blueprint_scar"] = { name = "Калька", desc = "Вручную нанесён синий узор, напоминающий архитектурный чертёж.\n\nЛучший план — масштабный" },
	["gs_cz_snakes_purple"] = { name = "Сян-лю", desc = "Украшено узором с девятью фиолетовыми и золотыми змеями.\n\nБойся восходящей волны" },
	["gs_m4a1_decimator"] = { name = "Опустошитель", desc = "Частично окрашено в чумовые синий и розовый цвета.\n\nТихий ретрофутуризм" },
	["cu_desert_eagle_corroden"] = { name = "Оксидное пламя", desc = "Корпус покрыт основой цвета ржавчины, на которую нанесён белый узор.\n\nНаждачка всё исправит" },
	["cu_fiveseven_vein"] = { name = "Капилляры", desc = "На корпус нанесён замысловатый узор из синих и коралловых вен.\n\n20 на 100" },
	["sp_galil_wave"] = { name = "Багровое цунами", desc = "Корпус покрыт каштановой основой, на которую баллончиком нанесён узор в виде синей волны.\n\nЗападный прибой" },
	["sp_m249_frog_original"] = { name = "Укус изумрудного яда", desc = "С помощью аквапечати нанесён рисунок в виде лягушки-древолаза.\n\nЛес рубят — пули летят" },
	["sp_mp7_tribal_yellow"] = { name = "Горн войны", desc = "Корпус покрыт жёлтой основой, на которую баллончиком нанесён синий узор.\n\nВаш личный боевой клич" },
	["am_p250_sputnik"] = { name = "Зыбь", desc = "Корпус покрыт чёрной основой, на которую серо-голубой краской нанесён анодированный узор.\n\nСтань камешком" },
	["aa_mac10_the_last_dive"] = { name = "Последнее погружение", desc = "На корпус вручную нанесён случайный зелёно-оранжевый узор.\n\nКрасота в беспорядке" },
	["gs_ump_abyss"] = { name = "Каркас", desc = "Вручную покрашено в цвет морской волны с убедительным эффектом глубины.\n\nМы строили, строили..." },
	["cu_usps_noir"] = { name = "Неонуар", desc = "Корпус покрыт серой основой, на которую вручную нанесено стилизованное пурпурно-голубое изображение девушки.\n\n«Она лежит у подножия гнетущего небоскрёба, залитая неоновым сиянием»" },
	["aq_xm_leaf_fade"] = { name = "Времена года", desc = "На корпус вручную нанесён случайный узор из листьев нескольких цветов.\n\nВесна, лето, осень — и иногда весна" },
	["aq_sawedoff_zander2"] = { name = "Судак", desc = "Вручную был нанесён узор, напоминающий популярную рыбу для спортивной ловли.\n\nХороший улов" },
	["hy_p90_barebones_blue"] = { name = "Мёртвая хватка", desc = "На голубую основу с помощью аквапечати нанесён узор в виде множества рук.\n\nУходи громко" },
	["cu_usps_blueprint"] = { name = "Калька", desc = "Вручную нанесён синий узор, напоминающий архитектурный чертёж.\n\nИногда даже лучший план идёт наперекосяк" },
	["gs_ak_colony01_red"] = { name = "Орбита, вер. 01", desc = "Вручную нанесён красно-чёрный узор.\n\nНаходка из Колонии-01" },
	["gs_dualberettas_cobra"] = { name = "Удар кобры", desc = "Изображение кобры вручную нанесено на обе рукояти. Неоновая краска на стволе символизирует её яд.\n\nОни всегда наносят ответный удар" },
	["sp_famas_macabre"] = { name = "Макабр", desc = "Корпус покрыт жёлтой основой, на которую баллончиками нанесён зелёный рисунок.\n\nЖуткая находка" },
	["cu_fiveseven_hyperbeast"] = { name = "Скоростной зверь", desc = "Нанесено изображение чудовища в ядовитых красках.\n\nМы все чудовища" },
	["cu_galil_candychaos"] = { name = "Конфетка", desc = "На корпус нанесены различные узоры цвета сахарной ваты.\n\nСмертельная доза сладостей" },
	["cu_awp_hannya"] = { name = "Великий демон", desc = "Вручную нанесён рисунок самурая и японского демона.\n\nВзгляни в глаза своим демонам" },
	["cu_m4a1s_metritera"] = { name = "Брифинг", desc = "С помощью аквапечати нанесён рисунок топографической карты.\n\nКарта всегда с собой..." },
	["cu_m4a4_hellfire"] = { name = "Адское пламя", desc = "Вручную нанесён рисунок чёртика в огне и цепях.\n\nИ серые черепушки" },
	["am_mac10_aloha"] = { name = "Алоха", desc = "Аэрографом нанесён узор в виде красного гибискуса.\n\nДля уклончивых" },
	["am_mag7_caustic"] = { name = "Насыщенная вода", desc = "Раскрашено в серый анодированный узор, а некоторые детали выделены синей краской.\n\n«Я бы не стал это пить»" },
	["aq_ump45_flameflower"] = { name = "Металлические цветы", desc = "На корпус нанесён узор в виде стальных погребальных роз.\n\nПамять о погибших" },
	["cu_p2000_hunter"] = { name = "Дровосек", desc = "Вручную нанесён зелёный камуфляж с оранжевыми элементами.\n\n«Оранжевая сторона — для тебя»" },
	["cu_p250_axiom"] = { name = "Красный камень", desc = "Нанесён особый пиксельный камуфляж с использованием жёлтого и оранжевого цветов.\n\nТам, за горизонтом" },
	["cu_ssg08_deathshead"] = { name = "Мёртвые головы", desc = "Вручную нанесён узор, напоминающий крылья бражника мёртвая голова.\n\nУслуга за услугу" },
	["aq_tec9_chalk_pattern"] = { name = "Трафарет", desc = "Нанесён замысловатый узор в виде бабочек и цветов.\n\nВесеннее цветение" },
	["aq_sawed-off_flower"] = { name = "Моррис", desc = "Вручную нанесён изысканный рисунок цветов в бледной цветовой палитре.\n\nМода для ближнего боя" },
	["cu_aug_orange_triangle"] = { name = "Квадрант", desc = "Корпус покрыт грязно-оранжевой основой, на которую нанесены рисунки металлических треугольников и углеволокна.\n\nРавенство во всём" },
	["gs_ak47_empress"] = { name = "Императрица", desc = "На корпус нанесён рисунок, вдохновлённый картой таро «Императрица».\n\nУ богатства много обличий" },
	["cu_bizon_all_in"] = { name = "Азарт", desc = "На красную основу нанесён рисунок покерных фишек, игральных костей и покерной комбинации флеш-рояль.\n\nСтавлю всё" },
	["gs_g3sg1_cetme_redux"] = { name = "Следопыт", desc = "Корпус покрыт чёрной основой и обшит тёмным деревом.\n\nПахнет роскошным красным деревом" },
	["cu_p250_cybercroc"] = { name = "Прощальный оскал", desc = "Рисунок зелёного металлического крокодила с жёлтыми элементами.\n\nХорошо, что вы зелёный и плоский..." },
	["cu_mp9_goo"] = { name = "Слизь", desc = "Корпус покрыт серой основой, на которую нанесён рисунок, напоминающий смолистую слизь.\n\nПокрыто злобой" },
	["cu_glock_indigo"] = { name = "Пришелец", desc = "На корпус вручную нанесли несколько слоёв голубой краски.\n\nВерхний слой ещё не высох" },
	["gs_m4a1_shatter"] = { name = "Хрусталь", desc = "Вручную нанесён рисунок, напоминающий голубые и оранжевые осколки.\n\nСмертельная хрупкость" },
	["am_mac10_oceani"] = { name = "Океанские мотивы", desc = "Корпус покрыт чёрной основой, на которую нанесены синие элементы.\n\nБесформенная бездна" },
	["gs_r8_llamacannon"] = { name = "Лама-пушка", desc = "Ручка слоновой кости сочетается с витиеватой гравировкой на синем металле.\n\nЖми на рычаг" },
	["cu_tec9_cracked_opal"] = { name = "Треснувший опал", desc = "Вручную нанесён рисунок, напоминающий трещины на древнем дереве, сквозь которые проглядывает свет опалов.\n\nТакже работает как кольцо настроения" },
