	["cu_scar_assault"] = { name = "Тот самый контейнер", desc = "Корпус покрыли голубой основой, поверх которой вручную нанесли белый логотип исследовательского центра.\n\nТеперь и в красном" },
	["gs_mp5_fbi"] = { name = "Агент", desc = "Корпус окрашен в фирменный для агентов ФБР синий цвет и дополнен жёлтыми элементами.\n\n«Будет что рассказать внукам»" },
	["cu_ump_bomb"] = { name = "Взрывчатка", desc = "На корпус нанесено изображение проводов, зелёной платы и цифровой клавиатуры.\n\n73556**" },
	["cu_awp_wildfire"] = { name = "Дикое пламя", desc = "Корпус покрыт чёрной и красной основой, поверх которой нанесён логотип операции «Дикое пламя».\n\nТорчащий гвоздь забивают" },
	["cu_glock_hero"] = { name = "Жертвенность", desc = "На корпус нанесён рисунок, чествующий знаменитый момент на ESL One 2014 в Кёльне, когда объятый пламенем olofmeister разминировал бомбу на карте Overpass.\n\n«Разминирование идёт... а он не останавливается!»" },
	["gs_famas_legacy_gold"] = { name = "Дань уважения", desc = "Корпус украшен золотым рисунком с различными элементами, чествующими двадцатилетие игры Counter-Strike.\n\nНу что, ещё 20?" },
	["gs_ak47_gold_arabesque"] = { name = "Золотая арабеска", desc = "На прикладе и цевье вручную нанесён замысловатый рисунок. Металлическая часть окрашена в золотой цвет с вкраплениями филиграни.\n\n«Какие ещё козыри остались в рукаве у Бута?»" },
	["am_lizard_red"] = { name = "Оранжевый анолис", desc = "На корпус нанесён красно-золотой узор, напоминающий чешую ящерицы.\n\nЩерится как ящерица" },
	["hy_brush_camo_tan"] = { name = "Пустынный окрас", desc = "Аквапечатью нанесён узор цвета песка.\n\nТестирование эффективности камфуляжа, первая стадия" },
	["hy_ddpat_urban_red"] = { name = "Пиксельный камуфляж «Красный»", desc = "Красная текстура пиксельного камуфляжа нанесена водостойкой краской.\n\nКогда ты сможешь различить камуфляж, будет уже слишком поздно" },
	["hy_dry_wood"] = { name = "Застарелое дерево", desc = "Аквапечатью нанесён узор, напоминающий сухое дерево.\n\n«Постучи по дереву, удача тебе пригодится», — командир Феликс Райли" },
	["hy_desert_multicam"] = { name = "Чёрно-бежевый", desc = "Аквапечатью нанесён чёрно-бежевый мультикам.\n\nКто не стреляет, тот не промахивается" },
	["hy_torn_camo_paints"] = { name = "Зыбучие пески", desc = "На приклад и ствольную коробку аквапечатью нанесён бежево-синий узор. Ствол окрашен в тёмно-синий цвет.\n\nПриятное зрелище, мягко говоря" },
	["sp_moro_carving_lightblue"] = { name = "Новые корни", desc = "Баллончиком нанесён узор из лоз и цветов различных оттенков зелёного\n\nЕсть куда расти" },
	["sp_moro_carving_yellow"] = { name = "Старые корни", desc = "Баллончиком нанесён узор из лоз и цветов различных оттенков зелёного\n\nСостоявшийся, закалённый, матёрый... Так и говори — старый." },
	["sp_moro_textile_purple_yellow"] = { name = "Увядшая лоза", desc = "Баллончиком нанесён цветочный узор фиолетово-золотого цвета.\n\nКому сорняк, а мне — красота" },
	["sp_palm_night"] = { name = "Полуночная пальма", desc = "Баллончиком нанесён рисунок чёрных пальмовых ветвей на серо-фиолетовом камуфляже.\n\nСказано же: закрыто!»" },
	["sp_desert_skulls"] = { name = "Белизна", desc = "Баллончиком нанесён узор в виде черепов животных.\n\nВсё, что осталось" },
	["sp_zebracam_red"] = { name = "Жертва", desc = "Баллончиком нанесён узор из полос зебры ржавого цвета.\n\nЕшь, спи, убей, повтори" },
	["cu_ssg08_scorpion"] = { name = "Жало смерти", desc = "По императорскому скорпиону струится песок.\n\nБудет жжечься..." },
	["hy_desert_bloom"] = { name = "Сушь", desc = "На сухую потрескавшуюся основу баллончиком нанесён яркий цветочный рисунок.\n\nПрирода всегда побеждает" },
	["am_ddpat_purple"] = { name = "Пиксельный камуфляж «Фиолетовый»", desc = "Фиолетовая текстура пиксельного камуфляжа нанесена водостойкой краской.\n\nКогда ты сможешь различить камуфляж, будет уже слишком поздно" },
	["gs_awp_hydra"] = { name = "Пустынная гидра", desc = "По стволу этой винтовки ползут золотые змеи. Прицел, ствол и задняя часть приклада окрашены в белый цвет.\n\n«Отрежешь одну голову — вырастут ещё две. Рискнёте?» — Валерия Дженнер, революционерка" },
	["gs_deagle_fennec"] = { name = "Фенек", desc = "На ствол нанесён рисунок фенека, а рукоять расписана бирюзовым и оранжевым цветами.\n\nЭто чтобы тебя лучше слышать" },
	["am_mirage_flowers_metalic"] = { name = "Музыкальная шкатулка", desc = "На корпус нанесён золотой дамасский узор.\n\nПышная перестрелка" },
	["am_moro_textile_bright"] = { name = "Элегантные лозы", desc = "Баллончиком нанесён цветочный узор красного и зелёного цвета.\n\nКому сорняк, а мне — красота" },
	["am_navy_shine"] = { name = "Флотский блеск", desc = "На корпус с помощью аквапечати нанесли узор смешанного камуфляжа морского синего цвета.\n\nЧто, штормит?" },
	["gs_aug_sand_storm"] = { name = "Песчаная буря", desc = "На оружие нанесено изображение песчаной бури под ночным небом.\n\nНас окружает красота. Надо лишь знать, куда смотреть." },
	["sp_dry_wood"] = { name = "Сплавной лес", desc = "Баллончиком нанесён коричневый узор, напоминающий сухое дерево.\n\n«Постучи по дереву, удача тебе пригодится», — командир Феликс Райли" },
	["sp_desert_skulls_dawn"] = { name = "Безводье", desc = "Баллончиком нанесён узор в виде черепов животных.\n\nВсё, что осталось" },
	["sp_mirage_flowers_tan"] = { name = "Дамасская охра", desc = "Корпус покрыли основой древесного цвета, поверх которой баллончиком нанесли дамасский цветочный узор.\n\nВообще-то лучший камуфляж — это тот, который не привлекает внимание..." },
	["sp_moro_carving_burnt"] = { name = "Хьюмидор", desc = "Баллончиком нанесён узор из коричневых и фиолетовых лоз и цветов.\n\n«Что же они здесь хранят?»" },
	["sp_moro_textile_green_vine"] = { name = "Буйная растительность", desc = "Баллончиком нанесён цветочный узор различных оттенков зелёного цвета.\n\nКому сорняк, а мне — красота" },
	["gs_mp5_neon_flektarn"] = { name = "Оксидный оазис", desc = "На корпус нанесён камуфляж ярко-оранжевого и бирюзового цветов, дополненный золотыми элементами.\n\nТакое тихое оружие не должно быть настолько кричащим" },
	["aa_desert_bloom_bright"] = { name = "Пустынное цветение", desc = "На сухую потрескавшуюся основу баллончиком нанесён яркий цветочный рисунок.\n\nПрирода всегда побеждает" },
	["hy_lizard_skin"] = { name = "Анолис", desc = "На корпус аквапечатью нанесён чёрно-зелёный узор, напоминающий чешую ящерицы.\n\nЩерится как ящерица" },
	["cu_ak-47_phantom_disruptor"] = { name = "Фантомный вредитель", desc = "На матово-чёрный корпус нанесён рисунок существа туманных очертаний.\n\n«Он может быть чем захочет и где захочет, но всё же предпочитает быть рядом с тобой»." },
	["gs_aug_thunderstorm"] = { name = "Кот-истребитель", desc = "На серо-синюю основу нанесены золотые элементы, обратные стрелки и рисунок злорадного кота.\n\nЕсли в небе гроза — это природа мурлычет" },
	["cu_awp_vein"] = { name = "Капилляры", desc = "На корпус нанесён замысловатый узор из синих и коралловых вен.\n\nКлюч к сердцу агента стоит 4750 долларов" },
	["cu_cz75_cerakote"] = { name = "Поношенный", desc = "Керамическая краска цвета меди уже стирается от использования.\n\nС годами только лучше" },
	["cu_deagle_replica"] = { name = "Синяя фанера", desc = "Ламинированный корпус с пепельной рукоятью и синим затвором.\n\nОСТОРОЖНО: этот муляж не проверялся с боевыми патронами" },
	["cu_m4a1s_csgo2048"] = { name = "Второй игрок", desc = "Оружие окрашено в яркие цвета, и на него нанесены мультипликационные рисунки спецназовца GIGN и собаки Pop Dog.\n\nНажмите кнопку «Start»..." },
	["cu_mac10_nacre"] = { name = "Дискотехника", desc = "Перламутровая окраска напоминает самоклеющийся голографический винил. Внешний вид меняется в зависимости от освещения.\n\nСмотри не куда целишься, а чем" },
	["gs_mag7_justice"] = { name = "Справедливость", desc = "На корпус нанесён рисунок, вдохновлённый картой таро «Справедливость».\n\nВсем воздастся" },
	["cu_mp5_desert_strike"] = { name = "Пустынная атака", desc = "Раскрашено вручную в бронзовый и черный цвета в стиле хай-тек.\n\nАтакуй первым и последним" },
	["cu_negev_prototype"] = { name = "Прототип", desc = "Временно окрашено в белый и красный цвета, пока не готова финальная версия окраски.\n\nВер. 1.2.1, ОБР. 3422107" },
	["aq_p2000_acid_clover"] = { name = "Протравленный", desc = "Нанесён случайный многоцветный узор и изображение редкого четырёхлистного клевера.\n\nДумаешь, повезёт?" },
	["gs_r8_leviathan"] = { name = "Кованая кость", desc = "На рукоять револьвера нанесено изображение останков древнего морского существа.\n\nТо, что скрывается в глубинах" },
	["cu_sawedoff_apocalypto"] = { name = "Апокалипто", desc = "На фоновое изображение внеземного пространства нанесён рисунок разлагающейся руки, тянущейся к напоминающей бомбу планете.\n\n«Хватит ли тебе времени?»" },
	["gs_scar20_enforcer"] = { name = "Принудитель", desc = "На отдельные части оружия аккуратно нанесён градиент, напоминающий закат.\n\nАвтоматические решения от SYMETRY SMART GUN CORP" },
	["cu_sg553_darkwing"] = { name = "Темнокрыл", desc = "Окраска в красный и чёрный цвета с рисунками перьев и тёмными элементами.\n\nЗоркая как орёл и крайне смертоносная. Хоть эта птичка и не летает, но опаснее неё на свете нет" },
	["cu_ssg08_fever_dream"] = { name = "Горячечные грёзы", desc = "Корпус покрыт чёрной основой, на которую нанесены сумасшедшие розовые, голубые и фиолетовые рисунки.\n\nХ@@ХХ@Х@Х@ХA!!" },
	["cu_glock18_warmaiden"] = { name = "Королева пуль", desc = "На жёлто-чёрную основу нанесены рисунки грозных пуль и Девы войны в розовой куртке.\n\n«Прекращу стрелять, когда ты прекратишь на меня шикать»." },
	["cu_negev_ultralight"] = { name = "Сверхлёгкий", desc = "На корпус нанесён серый пиксельный камуфляж и бирюзовые стрелки.\n\nЛёгкий как пёрышко" },
	["cu_ak47_anubis"] = { name = "Легион Анубиса", desc = "На корпус нанесён рисунок египетских богов Анубиса и Ра, олицетворяющий баланс между жизнью и смертью.\n\nДа склонится чаша весов в вашу пользу" },
	["aq_p2000_lost_world"] = { name = "Искривление", desc = "С рукояти к затвору протягивается нарисованная вручную искривлённая чужеродная сущность.\n\nИз тёмных уголков бесконечной пустоты" },
	["cu_mag7_monster_call"] = { name = "Зов монстра", desc = "На синий фон нанесён рисунок подводных существ.\n\nВсегда найдётся рыба крупнее и зеленее" },
	["cu_printstream"] = { name = "Поток информации", desc = "Строгий чёрно-белый рисунок украшен перламутровыми элементами.\n\nБЕЛИЗНА_1; ЧЕРНОТА_1; ПЕРЛАМУТР_1;" },
	["cu_glock_eyecontact"] = { name = "Мода", desc = "Затвор этого окрашенного в стиле поп-арт пистолета украшает пара глаз.\n\n«Смотри на меня, пока я в тебя стреляю!»" },
	["gs_tec9_guerilla"] = { name = "Брат", desc = "На корпус нанесён коричнево-золотой камуфляжный окрас, дополненный лицом террориста возле целика.\n\nЯ прикрою наши задницы" },
	["cu_mac10_isoonna"] = { name = "Шарм", desc = "Женщина в бирюзовых одеждах, так называемая Исо-онна, стоит перед карпом кои и бьющимися волнами.\n\nКрасота — к кровопролитию" },
	["gs_sg553_rusty"] = { name = "Старина Ржавчик", desc = "Влага изменила облик когда-то отполированной стали. Над спусковой скобой нанесено прозвище «Старина Ржавчик».\n\nРжавый и верный друг" },
	["cu_ssg08_mainframe"] = { name = "Мейнфрейм 001", desc = "На корпус нанесён рисунок синих и фиолетовых тонов в стиле хай-тек.\n\nКакие секреты скрывает _001?" },
	["cu_p250_cassette"] = { name = "Кассета", desc = "На корпус нанесён рисунок, вдохновлённый упаковками видеокассет из девяностых.\n\nПроверим плёнку" },
	["gs_p90_container"] = { name = "Грузовой", desc = "Окраска напоминает вагон поезда, покрытый граффити.\n\nИскусство — не вандализм" },
	["cu_xm1014_amulet_blue"] = { name = "Погребённый", desc = "Этот добытый в раскопках дробовик, погребённый тысячелетиями, украшен рисунком синих повязок и египетских узоров.\n\nПод стать фараону" },
	["cu_m4a4_queenfairy"] = { name = "Зубная фея", desc = "На корпус нанесён рисунок с резцами, коренными зубами и жутким образом зубной феи.\n\nНикто не говорил, что зубы должны быть твоими..." },
	["gs_galil_phoenix"] = { name = "Подразделение", desc = "На бело-красную основу баллончиком нанесены логотипы «Феникса».\n\nОни пускают в ход большие пушки" },
	["gs_bizon_hellraider"] = { name = "Рунопись", desc = "На корпус нанесён рисунок с неизвестными рунами, а магазин напоминает картечницу Гатлинга.\n\nЗадай им жару" },
	["gs_mp5sd_wasteland_legacy"] = { name = "Умелые ручки", desc = "Эта окраска собрала в себе 20 лет работы над MP5, скреплённые скотчем, стяжками и клеем.\n\nЕсли с первого (и второго, и третьего) раза не получилось..." },
	["gs_awp_exoskeleton"] = { name = "Экзоскелет", desc = "На корпус нанесли металлические пластины, тиснёные хитрыми узорами с черепами.\n\nВсё, понесло" },
	["gs_cz75_vendetta"] = { name = "Вендетта", desc = "За многие годы на пистолете успели и порисовать, и сделать насечки, да и время его не пощадило.\n\nИз моих холодных мёртвых рук" },
	["hy_p90_dino_rampage"] = { name = "Какао-буйство", desc = "Оливковой и золотой аквапечатью нанесён узор мультяшных динозавров.\n\nЗдесь и динозавры, и инопланетяне, и кометы! Ничего себе!" },
	["gs_dual_elites_dezastre"] = { name = "Катастрофа", desc = "На корпус нанесён бело-чёрный рисунок с красными нотками в стиле хай-тек.\n\nВсегда следуй инструкции по безопасной эксплуатации" },
	["cu_five_seven_diary"] = { name = "Сказка", desc = "На корпус нанесён рисунок с принцессой, единорогами, красивыми цветами и замком вдалеке.\n\n«Я так и чувствую, что сегодня будет чудесный день»." },
	["gs_g3sg1_disrupt"] = { name = "Цифровая сетка", desc = "На корпус нанесён пиксельный камуфляж красного, белого и угольного цветов.\n\nСмертоносные хитросплетения" },
	["gs_galil_vandal"] = { name = "Вандал", desc = "Поверх зелёной основы нанесли различные белые рисунки.\n\nУ каждого рисунка своя история, одна интереснее другой" },
	["cu_p250_infect"] = { name = "Загрязнитель", desc = "Бордовое покрытие выветрилось, оставив вид потрёпанного оружия, готового сломаться в любой момент.\n\nЧто видишь, то и получишь" },
	["cu_m249_deep_relief"] = { name = "Глубокий рельеф", desc = "Корпус покрыт краской песочного цвета, которая с каждым слоем становится всё более тёмно-зелёным. Этот рисунок можно ощутить на ощупь.\n\nСколько пуль доберётся до центра?" },
	["cu_m4a4_cyberpunk"] = { name = "Кибербезопасность", desc = "Поверх чёрной основы нанесены диагональные полосы синего, красного и золотого цветов.\n\nИЩИТЕ В БЛИЖАЙШИХ МАГАЗИНАХ КИБЕРНЕТИКИ" },
	["gs_mp5_conditionzero"] = { name = "Condition Zero", desc = "На корпус вручную нанесён жёлто-синий рисунок, воздающий почести игре Counter-Strike: Condition Zero.\n\n«РПГ на три часа! Уклоняемся!»" },
	["cu_nova_polymer"] = { name = "Прозрачный полимер", desc = "На корпус нанесён рисунок, создающий иллюзию прозрачности, словно вы можете разглядеть внутренности этого оружия.\n\nТвои намёки прозрачнее некуда" },
	["cu_glock_noir"] = { name = "Неонуар", desc = "На серую основу вручную нанесено стилизованное пурпурно-голубое изображение девушки.\n\n«Казалось, всё налаживается, и она начала чувствовать надежду... но потом она посмотрела вверх»" },
	["cu_ssg08_chromatic"] = { name = "Параллакс", desc = "Цвета узора смещены, отчего покраска приобрела феерический вид.\n\nДва выстрела, один труп" },
	["gs_ump_gold_bismuth"] = { name = "Золотой висмут", desc = "На чёрно-белую основу нанесли несколько слоёв золотой краски, чтобы придать ей вид кристаллов висмута.\n\n«А у вас нескромный аппетит...»" },
	["cu_usp_krokos"] = { name = "Чудовищная смесь", desc = "На корпус нанесён рисунок зелёного монстра и других мотивов, вдохновлённых популярным стрит-артом. Глушитель покрыт перламутровой краской.\n\nX__X" },
	["cu_csgo_camo"] = { name = "Global Offensive", desc = "На корпус нанесён узор из синего, жёлтого и серого камуфляжа.\n\n«Первый удар мы нанесём в Гарце, Германия. Ровно в 17:25 по Гринвичу +1...»" },
	["am_authority_brown"] = { name = "Хартия", desc = "На корпус нанесён узор цвета загара из различных гербов, надписей и текста из Великой хартии вольностей.\n\nНикто не выше закона... даже ты" },
	["hy_authority_purple"] = { name = "Магна Карта", desc = "На корпус нанесён фиолетовый узор из различных гербов, надписей и текста из Великой хартии вольностей.\n\nНикто не выше закона... даже ты" },
	["am_intelligence_grey"] = { name = "Слежка", desc = "На корпус нанесён узор в виде карты с элементами интерфейса разведывательного дрона.\n\nЦель найдена" },
	["am_intelligence_orange"] = { name = "Обнаружена угроза", desc = "На корпус нанесён узор в виде карты с элементами интерфейса разведывательного дрона.\n\nЦель найдена" },
