	["cu_ump_crime_scene"] = { name = "Место преступления", desc = "Корпус покрыт красно-синей основой, на которую нанесена жёлтая сигнальная лента.\n\nРасходитесь, нам нужно работать..." },
	["am_m4a1s_bluesmoke"] = { name = "Синий фосфор", desc = "Корпус покрыли синей хромовой основой, поверх которой нанесли несколько слоёв голубой металлической краски.\n\nТоска цвета неба" },
	["cu_ak_xray"] = { name = "Рентген", desc = "На оружие нанесен рентгеновский снимок внутреннего механизма AK-47.\n\nНеприкрытая истина не каждому придётся по душе..." },
	["am_heist_plans_green"] = { name = "Ограбление", desc = "На бежевую основу нанесли анодированный узор в виде карты. Похоже, что после этого на ней уже кто-то успел порисовать.\n\nПланирование — это одно, а исполнение — совсем другое" },
	["am_heist_plans_purple"] = { name = "Ночное ограбление", desc = "На фиолетовую основу нанесли анодированный узор в виде карты. Похоже, что после этого на ней уже кто-то успел порисовать.\n\nПланирование — это одно, а исполнение — совсем другое" },
	["am_heist_plans_yellow"] = { name = "Ограбление хранилища", desc = "На серую основу нанесли анодированный узор в виде карты. Похоже, что после этого на ней уже кто-то успел порисовать.\n\nПланирование — это одно, а исполнение — совсем другое" },
	["hy_houndstooth_brown"] = { name = "Гусиные лапки", desc = "Аквапечатью нанесён коричневый узор «гусиные лапки».\n\nНе оружие выбирает тебя, а ты его" },
	["gs_mac10_snake"] = { name = "Ужи на сковородке", desc = "На корпус вручную нанесли узор из бронзовой змеиной кожи и рисунок свернувшейся возле приклада гадюки.\n\nЭто шипят пролетающие пули" },
	["hy_phoenix_tags_lilac"] = { name = "Мел «Феникса»", desc = "На корпус нанесён цветной узор из разных граффити подразделения «Феникс».\n\n«Думаете, вы победите? Глупцы!»" },
