	["am_tigers_brown"] = { name = "Тигриная яма", desc = "Корпус покрыт чёрной основой, на которую аквапечатью нанесён тигровый узор коричневых цветов.\n\nКуда угодно, но только не туда" },
	["am_tigers_blue"] = { name = "Шёлковый тигр", desc = "Корпус покрыт синей основой, на которую аквапечатью нанесён тигровый узор.\n\nДостояние нации... Речь о тиграх, не о винтовке" },
	["cu_m4a1_snake"] = { name = "Добро пожаловать в джунгли", desc = "На корпус нанесён рисунок с древней иллюстрацией и золотистой гремучей змеёй на фоне джунглей в свете сумерек.\n\nБей без предупреждения" },
	["cu_ak_jaguar"] = { name = "Panthera onca", desc = "Дерево на прикладе и цевье украшены резными узорами, часто отвлекающими от рисунка ягуара, который нанесли сбоку корпуса.\n\nКто сказал, что старого кота не научишь новым трюкам?" },
	["cu_jaguar_p90"] = { name = "Беги и прячься", desc = "На корпус нанесён узор шкуры ягуара, дополненный рисунком зернистой кожи.\n\nЛюбой может накупить модных вещей, но очень немногие обладают настоящим стилем" },
	["aa_ancient_brown"] = { name = "Древняя земля", desc = "На корпус нанесены коричневые и золотые узоры с замысловатыми полосами и древними существами.\n\nТакую честь я предоставлю тебе" },
	["am_ancient_warm"] = { name = "Древняя истина", desc = "На корпус нанесён узор из древних плиток бледно-зелёного, бежевого и красного цветов.\n\n«Надежда остаётся даже с теми, кто пошёл по неправильному пути»" },
	["aa_ruins_green"] = { name = "Заросшие руины", desc = "На корпус нанесён рисунок с древними богами, закрытыми узором из роскошной растительности.\n\n«Глядите в оба — за нами следят...»" },
	["hy_ancient_tiles_peach"] = { name = "Привет из прошлого", desc = "На корпус нанесён узор из древних плиток бледно-зелёного и бежевого цветов.\n\n«Надежда остаётся даже с теми, кто пошёл по неправильному пути»" },
	["am_gold_brick"] = { name = "Золотой кирпич", desc = "Золотое покрытие блестит на свету, подчёркивая каждое очаровательное несовершенство корпуса.\n\nВсё, что блестит..." },
	["sp_ancient_bright"] = { name = "Древние видения", desc = "На корпус нанесены коричневые и золотые узоры с замысловатыми полосами и древними существами.\n\nТакую честь я предоставлю тебе" },
