	["am_jade"] = { name = "Резной нефрит", desc = "На основу нанесли хромовое покрытие, а потом окрасили тонким слоем нефритово-зелёной краски, чтобы создать эффект анодированного металла.\n\nЛучшее из лучшего" },
	["am_ancient_wine"] = { name = "Древний ритуал", desc = "На корпус нанесены коричневые и золотые узоры с замысловатыми полосами и древними существами.\n\nТакую честь я предоставлю тебе" },
	["hy_drywood_green"] = { name = "Бурьян", desc = "Аквапечатью нанесён узор из зелёной травы.\n\nВ высокой траве тебя не ждёт ничего хорошего" },
