	["gs_ak47_professional"] = { name = "Сланец", desc = "На корпус нанесён рисунок, который можно описать лишь словами «чёрный на чёрном на сланцевом чёрном».\n\n«Вызывай врача, он им понадобится»" },
	["cu_cz75_whirlwind"] = { name = "Настоящий змееяд", desc = "На этот пистолет нанесён рисунок хищной птицы, несущей змею.\n\nПожиратель змей, но без прилипчивой заглавной темы" },
	["cu_mp9_food_chain"] = { name = "Пищевая цепь", desc = "На этот цветастый пистолет-пулемёт нанесён рисунок с пищевой цепью чудовищ.\n\nЛибо ты, либо они" },
	["cu_galil_chroma_pink"] = { name = "Хроматическая аберрация", desc = "Цвета узора смещены, отчего покраска приобрела феерический вид.\n\n(Не так уж и) радует глаз..." },
	["gs_glock_polymer"] = { name = "Прозрачный полимер", desc = "Затвор покрашен в бежевый цвет, а спусковой крючок — в голубой. Корпус сделан из прозрачного полимера.\n\nЧто видишь, то и получишь" },
	["gs_usps_hangedman"] = { name = "Предатель", desc = "На корпус нанесён рисунок, вдохновлённый картой таро «Повешенный».\n\nПрошлые неудачи — чертежи будущих побед" },
	["cu_m4a4_love"] = { name = "В живом цвете", desc = "Корпус окрашен в неоновые цвета и расписан вручную.\n\nСражаясь за одного, сражайся за всех" },
