	["cu_mac10_portable"] = { name = "Кнопкодав", desc = "На этот пистолет-пулемёт нанесён рисунок, напоминающий геймпад с кнопками, проглядывающими через корпус из прозрачного полимера.\n\nКонсольные войны принимают новый оборот" },
	["aq_xm1014_punk"] = { name = "Целую-обнимаю", desc = "На корпус нанесён яркий узор в стиле «панк».\n\nНу да, ну да..." },
