	["am_ump45_electrowave"] = { name = "Осциллятор", desc = "На корпус нанесён случайный узор оранжевого, чёрного и серого цветов.\n\nУ каждого есть точка перелома. Где же твоя?" },
	["cu_deag_trigger_discipline"] = { name = "Стрелковая дисциплина", desc = "На ствол нанесён розовый изометрический узор, а курок и мушка окрашены в ярко-синий цвет.\n\nТерпение вознаграждается" },
	["sp_nova_wind_dispersal"] = { name = "На крыльях ветра", desc = "Баллончиком нанесён случайный узор одуванчикового поля.\n\nУбирайся с моего газона" },
	["am_nuclear_pattern4_famas"] = { name = "Авария", desc = "С помощью металлизированных красок нанесен узор в виде знаков радиоактивной угрозы.\n\nПока не подходи..." },
	["aa_spacerace_orange"] = { name = "Космическая гонка", desc = "На корпус нанесён космический узор в виде звёзд и спутников.\n\nОтправляй и получай" },
