	["gs_m4a4_coalition"] = { name = "Коалиция", desc = "На корпус нанесён чёрно-золотой рисунок пересекающихся треугольников и синих элементов.\n\nЭтот альянс временный, но я могу и передумать…" },
	["cu_mac10_propaganda"] = { name = "Пропаганда", desc = "На корпусе нарисована пара глаз и написаны различные слова.\n\nТы же им не веришь?" },
