	["hy_geometric_steps_pearl"] = { name = "Призменная застройка", desc = "Перламутровый узор в виде оптической иллюзии.\n\nГде тут начало и где конец? Есть ли он вообще?" },
	["gs_m4a1_vertigo"] = { name = "Неотвратимая угроза", desc = "На корпус нанесены разноцветные рисунки предупреждающих знаков.\n\n«Не говори, что я тебя не предупреждал», — Бут, торговец оружием" },
	["hy_vertigogeo"] = { name = "Схематика", desc = "На корпус нанесён разноцветный узор изометрической сетки.\n\nТы помнишь боль, а я помню победу" },
	["hy_vertigospray_blue"] = { name = "Тактика", desc = "С помощью аквапечати нанесён узор в виде плана строительства, вентиляции и проводки 51 этажа.\n\nВсё согласно плану…" },
	["hy_vertigoillusion"] = { name = "Фреймворк", desc = "Аквапечатью нанесён узор в видео серо-бежевой оптической иллюзии.\n\nХорошо видно?" },
