	["gs_mag7_bismuth"] = { name = "Висмутовый спектр", desc = "На корпус нанесён рисунок, напоминающий переливчатые кристаллы висмута.\n\nПочему же редкость так манит?" },
	["cu_deagle_kitch"] = { name = "Океанское побережье", desc = "На корпус нанесены различные формы чрезмерно насыщенных цветов.\n\nПоражает не только цель, но и её взор" },
