	["cu_famas_spectron"] = { name = "ZX Spectron", desc = "На корпус нанесён рисунок, вдохновлённый старыми игровыми компьютерами. Чёрная основа дополнена разноцветными элементами\n\nКлайв бы гордился" },
	["gs_five_seven_efusion"] = { name = "Протокол «Подъём»", desc = "Корпус окрашен в контрастные цвета. Иконка робота под целиком соответствует изображению на затворе.\n\nПозывной: МЕХА-0272" },
	["aa_mp9_fuji_pink"] = { name = "Фудзияма", desc = "На корпус нанесён акриловый рисунок Фудзиямы на рассвете. Рисунок используется как узор, поэтому каждое такое оружие выглядит по-своему.\n\nВосход красного солнца" },
	["cu_g3sg1_tacticalmap"] = { name = "Наблюдение", desc = "На корпус нанесено изображение, вдохновлённое тактической картой «Запретной зоны».\n\n«Вся нужная информация у тебя уже есть», — Франц Кригельд, стратег подразделения «Феникс»" },
	["cu_mp7_khaki"] = { name = "Диверсант", desc = "На зелёную основу нанесены чёрные элементы и изображение смотрящей вперёд обезьяны.\n\nЛев никогда не был королём джунглей" },
	["gs_m4_flowers"] = { name = "Ликорис лучистый", desc = "Корпус покрыт тёмно-синей основой, а над магазином и спусковым крючком нанесены изображения ликориса лучистого.\n\nЯркие цвета — это предостережение, а не приманка" },
	["cu_mac10_toybox"] = { name = "Коробка с игрушками", desc = "На корпус нанесены яркие рисунки курочек, пришельцев, наборов разминирования и не только.\n\nНадо бы прибраться" },
	["gs_bizon_flasher"] = { name = "Люмен", desc = "Корпус покрыт чёрной основой, на которую нанесены красные элементы. Магазин раскрашен так, чтобы он напоминал фонарик.\n\nОсвещай путь" },
	["cu_glock_snackattack"] = { name = "Нападение жора", desc = "На корпус нанесён рисунок, словно оружие покрыто прозрачной полимерной смолой с брелоками-фастфудинками внутри.\n\nПоследний перекус" },
	["cu_ssg_overtake"] = { name = "Турбовыпад", desc = "По бокам этой неоновой снайперской винтовки мчатся гоночные автомобили.\n\nДрифт — это право, а не привилегия" },
	["cu_usp_black_lotus"] = { name = "Чёрный лотос", desc = "На затвор нанесён рисунок чёрного лотоса.\n\nДобавьте три убийства в пистолетном раунде, затем сбросьте" },
	["gs_xm1014_watchdog"] = { name = "Настороже", desc = "На изумрудную основу нанесены два льва-стражника, смотрящих в противоположные стороны, а под целиком изображён третий лев.\n\nЗащищай и процветай" },
	["cu_ak47_nightwish"] = { name = "Пожелание на ночь", desc = "It has been custom painted with a deer and dreamcatchers in neon colors and finished with a pearlescent effect.\n\nI've been saving this for a special occasion... – Booth, Arms Dealer" },
