	["cu_m4a4_elite_tactical"] = { name = "Полимерный рожок", desc = "На магазин нанесён рисунок, создающий иллюзию прозрачного полимера, а приклад, цевье и рукоять покрашены в бежевый цвет.\n\nСтандартная операционная процедура" },
