	["cu_sawedoff_kisslove"] = { name = "Лафки♥Чмафки", desc = "На корпус нанесён розово-фиолетовый рисунок девушки с искрами в глазах.\n\n«Отказ не принимается! Хочу-хочу-хочу!»" },
