	["cu_glock_moon_rabbit"] = { name = "Кролик в тени", desc = "На оружии изображён загадочный кролик, прыгающий на фоне полной луны.\n\nСделай прыжок веры" },
	["cu_m4a4_temukau"] = { name = "Темукау", desc = "На оружие нанесено изображение в стиле японской анимации, на котором женщина-спецназовец отбивается от наседающих террористов.\n\n«Не сдавай позицию!»" },
