	["hy_ocean_bravo"] = { name = "hy_ocean_bravo", desc = "Этот сувенир с Seaside был окрашен с помощью голубой водоотталкивающей краски.\n\n«Мы привыкли скрываться… Но иногда камуфляж создан для того, чтобы его увидели», — Бут, торговец оружием" },
	["sp_spitfire_famas_bravo"] = { name = "sp_spitfire_famas_bravo", desc = "Этот сувенир с Cache был украшен акульей пастью в стиле рисунков, которые наносят на носовую часть самолета.\n\nДжестер сбит" },
	["hy_tile_bravo"] = { name = "hy_tile_bravo", desc = "Этот сувенир с Ali окрашен под мозаику при помощи аквапечати.\n\nТерпение есть добродетель" },
	["an_navy_bravo"] = { name = "an_navy_bravo", desc = "Основу этого сувенира из Ali покрыли хромом, а затем тонким слоем окрасили в полупрозрачный оттенок синего с эффектом анодированного металла.\n\n«Из-за слов лживой Валерии я уже потерял одного бойца… И это не повторится», — командир Феликс Райли" },
	["sp_hazard_bravo"] = { name = "sp_hazard_bravo", desc = "На этот сувенир с Siege с помощью баллончика нанесли полосы, напоминающие о знаке опасности.\n\nПРОХОД ЗАПРЕЩЕН" },
	["sp_tape_dots_bravo"] = { name = "sp_tape_dots_bravo", desc = "Этот сувенир с Gwalior был покрашен из баллончика с помощью рваных магнитофонных лент и перфорированного листа металла вместо трафаретов.\n\n«Не волнуйся… Скоро бизнес пойдет в гору», — Бут, торговец оружием" },
	["hy_ddpat_bravo"] = { name = "hy_ddpat_bravo", desc = "Пиксельный камуфляж этого сувенира с Ruins нанесен водостойкой краской.\n\nЕсли вы его не разглядите, то наверняка услышите" },
	["so_jungle_bravo"] = { name = "so_jungle_bravo", desc = "Части этого сувенира с Ruins с помощью баллончика покрасили в цвета, напоминающие о джунглях.\n\nДля людей, которые жаждут разрушения" },
	["so_tornado_bravo"] = { name = "so_tornado_bravo", desc = "Части этого сувенира с Ali с помощью баллончика покрасили в цвета, напоминающие о торнадо.\n\nНе бросай слов на ветер — он может убить" },
	["so_sand_bravo"] = { name = "so_sand_bravo", desc = "Части этого сувенира с Gwalior с помощью баллончика покрасили в цвета, напоминающие о песчаных дюнах.\n\nГонзо-журналист Алекс Кинсейд исчез после поездки в Магриб, где он писал об операции «Авангард»" },
	["so_olive_bravo"] = { name = "so_olive_bravo", desc = "Отдельные части этого сувенира с Cache окрашены распылителем в сплошной оливковый цвет.\n\nНикогда не принимай победу как должное" },
	["an_gunmetal_bravo"] = { name = "an_gunmetal_bravo", desc = "Основу этого сувенира с Siege покрыли хромом, а затем окрасили в металлический оттенок с анодированным эффектом.\n\n«Ты не знаешь Феликса Райли, как его знаю я… Этого человека не сломить», — Предатель и Правдолюб, часть 1" },
	["am_ossify_blue_p2000_bravo"] = { name = "am_ossify_blue_p2000_bravo", desc = "На металлическую основу этого сувенира с Seaside с помощью аквапечати нанесли полупрозрачный абстрактный узор синего цвета.\n\n«Волны разбиваются о берег, но наша решимость остается тверда», — Котаро Ицаки, специалист по штурму" },
	["am_crumple_bravo"] = { name = "am_crumple_bravo", desc = "На основу этого сувенира с Agency нанесли хромированное покрытие, а затем окрасили его под полигональную сетку различными оттенками металлических цветов.\n\nУрок окончен, руки вверх" },
	["aq_steel"] = { name = "aq_steel", desc = "Всё ещё отлично показывает себя в бою, несмотря на слой ржавчины. \n\nНекоторые люди не скрывают свои нечистые дела" },
	["hy_hex"] = { name = "hy_hex", desc = "Узор из шестиугольников нанесен с помощью аквапечати." },
	["hy_camo_large"] = { name = "hy_camo_large", desc = "С помощью аквапечати нанесен огромный камуфляжный рисунок." },
	["am_ddpatdense"] = { name = "am_ddpatdense", desc = "Покрыто металлической фольгой с оттиском в виде квадратных заржавевших участков металла." },
	["twigs"] = { name = "twigs", desc = "Рисунок нанесен баллончиком вручную с использованием веточек в качестве трафаретов." },
	["varicamo"] = { name = "varicamo", desc = "Узор в виде смешанного камуфляжа нанесен с помощью аквапечати.\n\nЗаново строят только после разрухи" },
	["aq_damascus_knife"] = { name = "aq_damascus_knife", desc = "Выкован из заготовки, сочетающей в себе два разных типа углеродистой стали.\n\nНаконец появилось оружие, достойное вашей непоколебимости" },
	["am_crystallized"] = { name = "am_crystallized", desc = "Раскрашено с помощью металлизированной краски с использованием трафарета в виде кристаллов.\n\nКаждый хочет внести свой вклад" },
	["snakeskin"] = { name = "snakeskin", desc = "Узор в виде змеиной кожи нанесен с помощью аквапечати.\n\n«Я знаю: ты мне не веришь… Но когда ты попадешься, Валерия получит твою голову», — Щит и Змей, часть 1" },
	["cu_usp-s_elegant"] = { name = "cu_usp-s_elegant", desc = "Раскрашено в синий цвет кобальта. С логотипом спецназа на затворе.\n\n«Буду действовать по правилам — освобожу семерых, буду действовать по разумению — вытащу всех десятерых… Выбор за вами», — Кармен Кочинеро, специалист по спасению заложников" },
	["hy_plaid2"] = { name = "hy_plaid2", desc = "С помощью аквапечати оружие покрасили в серый цвет и нанесли узор из синих и зеленых квадратов.\n\nЭта волынка играет на похоронах" },
	["cu_fiveseven_urban_hazard"] = { name = "cu_fiveseven_urban_hazard", desc = "Раскрашено вручную в городской камуфляж с красными вставками.\n\nКаждый год у Бута собираются известнейшие оружейники-художники, и они показывают ему свои лучшие работы" },
	["an_emerald"] = { name = "an_emerald", desc = "На покрытую хромом основу нанесли полупрозрачную изумрудную краску.\n\n«Что же случилось с великим Себастьеном Энке, что он стал как ворчливая старуха? Что же случилось с тобой?..» — Учитель и бунтарь, часть 2" },
	["so_keycolors"] = { name = "so_keycolors", desc = "Отдельные части оружия покрашены из баллончиков в сплошные голубой и оранжевый цвета.\n\nВеликий уравнитель" },
	["cu_awp_mastery"] = { name = "cu_awp_mastery", desc = "Окрашено вручную с использованием аквапечати, трафаретных изображений и термонаклеек.\n\n«Чейз Тернер был хорошим человеком... Вам будет непросто стать его достойным преемником», — Феникс и посвящение, часть 1" },
	["aq_dualberettas_cartel"] = { name = "aq_dualberettas_cartel", desc = "Нанесена гравировка в виде цветов, черепов и змей.\n\n«Поэтому Хаксли делает всю тяжелую работу, так что нужно лишь подтолкнуть ее...», — Змей и Правдолюб, часть 2" },
	["aq_famas_contour"] = { name = "aq_famas_contour", desc = "Раскрашен в современном красно-сером стиле, подчеркивающим форму оружия.\n\nВместе мы всегда сильнее" },
	["cu_nova_hyperbeast"] = { name = "cu_nova_hyperbeast", desc = "Нанесено изображение чудовища в ядовитых красках.\n\n«Они зовут тебя Демоном, верно? Такое грозное имя у такого жалкого человека...», — Эллиот Кингсман, наемник" },
	["hy_ocean_knife"] = { name = "hy_ocean_knife", desc = "Голубая камуфляжная расцветка была нанесена с помощью аквапечати." },
	["cu_m4a1s_printstream"] = { name = "cu_m4a1s_printstream", desc = "Строгий чёрно-белый рисунок украшен перламутровыми элементами.\n\nБЕЛИЗНА_1; ЧЕРНОТА_1; ПЕРЛАМУТР_1; ГЛУШИТЕЛЬ_1;" },
	["cu_usp_printstream"] = { name = "cu_usp_printstream", desc = "Строгий чёрно-белый рисунок украшен перламутровыми элементами.\n\nБЕЛИЗНА_1; ЧЕРНОТА_1; ПЕРЛАМУТР_1; ГЛУШИТЕЛЬ_1; ПИСТОЛЕТ_1;" },
}
